var sortingMinMax = 0

var lastColumnIndex = 1;

var abilitiesName = []

function abilitySortLoad(){
    abilitiesSelect = document.querySelector('.ability-filter')
    pokemonData.forEach(function(pokemon) {
        Object.keys(pokemon.abilities).forEach(function (ability){
            if (!abilitiesName.includes(pokemon.abilities[ability])) {
                abilitiesName.push(pokemon.abilities[ability])
            }
        })
    });
    abilitiesName.sort();
    abilitiesName.forEach(function(abilityName){
        var option = document.createElement('option');
        option.value = abilityName;
        option.textContent = abilityName;
        abilitiesSelect.appendChild(option);
    })
    statValues = document.querySelectorAll('.stat-value')
    for (let i = 0; i < 6; i++){
        document.querySelectorAll('.progress')[i].style.backgroundColor = setColor(+statValues[i].textContent);
        document.querySelectorAll('.progress')[i].style.borderBottomColor = setColor(+statValues[i].textContent, 'yes');
        document.querySelectorAll('.progress')[i].style.borderTopColor = setColor(+statValues[i].textContent, 'no');
    }
    populateTable();
}

function setColor(value, border = null) {
    var red, green, blue;
    if (value <= 50) {
        red = 255;
        green = Math.round(5.1 * value);
        blue = 0;
    } else if (value <= 100) {
        red = Math.round(510 - 5.1 * value);
        green = 255;
        blue = 0;
    } else if (value <= 150) {
        red = 0;
        green = 255;
        blue = Math.round(5.1 * value - 510);
    } else if (value <= 200) {
        red = 0;
        green = Math.round(510 - 5.1 * value);
        blue = 255;
    } else {
        red = Math.round(5.1 * value - 1020);
        green = 0;
        blue = 255;
    }
    if (border){
        if(border=='yes'){
            red -= 60
            green -= 60
            blue -= 60
        }
        else{
            red += 80
            green += 80
            blue += 80
        }
        if(red > 255){
            red = 255
        }if(blue > 255){
            blue = 255
        }if(green > 255){
            green = 255
        }
    }
    var color = "rgb(" + red + "," + green + "," + blue + ")";
    
    console.log(color, value)
    return color;
}

typesBase = "https://play.pokemonshowdown.com/sprites/types/"

iconUrl = "https://play.pokemonshowdown.com/sprites/pokemonicons-sheet.png?v16"

function iconLocation(pokemon) {
    if (pokemon.iconLoc) {
        return pokemon.iconLoc;
    }
    return "-" + (pokemon.num % 12 * 40) + "px -" + (Math.floor(pokemon.num / 12) * 30) + "px";
}

function filterPokemon(pokemonArray, filters) {
    return pokemonArray.map(pokemon => {
        for (const filter of filters) {
            if (!filter(pokemon)) {
                return { ...pokemon, show: 1 };
            }
        }
        return { ...pokemon, show: 0 };
    });
}

function searchUpdate(){
    

    inputValue = document.querySelector('.search input').value.toLowerCase()
    if (inputValue == ''){
        inputValue = null;
    }

    pointsSortValue = document.querySelector('.points-sort').value
    if (pointsSortValue == 'No' || pointsSortValue == ''){
        pointsSortValue = null;
    }
    else {
        pointsSortValue = +pointsSortValue
    }
    typeSortValue = document.querySelector('.type-sort').value

    
    abilitySortValue = document.querySelector('.ability-filter').value

    const filters = [];

    if (inputValue) {
        if (inputValue.includes('-')){
            filters.push(pokemon => pokemon.name.toLowerCase().includes(inputValue));
        }
        else{
            filters.push(pokemon => pokemon.name.toLowerCase().startsWith(inputValue));
        }
    }

    if ((pointsSortValue && pointsSortValue != 'No') || pointsSortValue == 0) {
        filters.push(pokemon => pokemon.points == +pointsSortValue);
    }

    if (typeSortValue != 'None') {
        filters.push(pokemon => pokemon.types.includes(typeSortValue));
    }
    
    if (abilitySortValue !== 'None') {
        filters.push(pokemon => Object.values(pokemon.abilities).includes(abilitySortValue));
    }


    if (filters.length > 0){
        document.querySelector('.left-menu-main').style.transform = 'translateX(0px)'
        pokemonData = filterPokemon(pokemonData, filters);
    }
    else{
        document.querySelector('.left-menu-main').style.transform = 'translateX(-100.1%)'
    }

    populateTable();
    sortTable(-1);
}

function openLeftMenu(){
    if(document.querySelector('.left-menu-main').style.transform == 'translateX(-100.1%)'){
        document.querySelector('.left-menu-main').style.transform = 'translateX(0px)';
    }
    else{
        document.querySelector('.left-menu-main').style.transform = 'translateX(-100.1%)';
    }
}

function hover(){
    if (document.getElementById("audio")){
        document.getElementById("audio").play();
        console.log('yes')
    }
}

function populateTable() {
    function goToPokemonPage(pokemonName) {
        window.location.href = pokemonName.toLowerCase() + ".html";
    }

    const tableBody = document.querySelector("#pokemonTable tbody");
    tableBody.innerHTML = "";
  
    pokemonData.forEach(pokemon => {
        if (pokemon.show == 0){
            const row = document.createElement("tr");
            row.classList.add('button-like');
            row.onclick = function() {
                goToPokemonPage(pokemon.name);
            };
    
            
            const iconCell = document.createElement('td');
            iconCell.innerHTML = '<span style="display:inline-block; width:40px; height:30px; background: transparent url('+ iconUrl + ') no-repeat scroll ' + iconLocation(pokemon) + ';"></span>';
            iconCell.classList.add('pokemon-icon')

            const nameCell = document.createElement('td');
            nameCell.innerText = pokemon.name;
            nameCell.classList.add('pokemon-name')
    
            const typeCell = document.createElement('td');
            typeCell.classList.add('pokemon-types')
            const img1 = document.createElement('img');
            img1.classList.add('typeimg');
            img1.src = typesBase + pokemon.types[0] + '.png';
            typeCell.appendChild(img1);
    
            if (pokemon.types.length > 1) {
                const img2 = document.createElement('img');
                img2.classList.add('typeimg');
                img2.src = typesBase + pokemon.types[1] + '.png';
                typeCell.appendChild(img2);
            }
    
            const pointsCell = document.createElement('td');
            pointsCell.innerText = pokemon.points;
    
            pointsCell.classList.add('pokemon-points')
    
            statSortValue = document.querySelector('.stat-sort').value
            const statCell = document.createElement('td');
            if(pokemon[statSortValue]){
                statCell.innerText = pokemon[statSortValue];
            }
            else if(statSortValue == "No"){
                statCell.innerText = pokemon.bst;
            }
            statCell.classList.add('pokemon-stat')
    
            row.appendChild(iconCell);
            row.appendChild(nameCell);
            row.appendChild(typeCell);
            row.appendChild(pointsCell);
            row.appendChild(statCell);
    
            tableBody.appendChild(row);
        }
    });
}

function sortTable(columnIndex) {
    if(columnIndex == 0 ){
        if (sortingMinMax == 0){
            sortingMinMax = 1;
        }
        else{
            sortingMinMax = 0;
        }
        sort(lastColumnIndex)
    }
    else{
        if (columnIndex == -1){
            statSortValue = document.querySelector('.stat-sort').value.toLowerCase()
            nums = {hp: 1, atk: 2, def: 3, spa: 4, spd: 5, spe:6, bst:7}
            if (nums[statSortValue]){
                lastColumnIndex = 4 + nums[statSortValue];
                sort(lastColumnIndex);
            }
            else if(statSortValue == "no"){
                lastColumnIndex = 1;
                sort(lastColumnIndex);
            }
        }
        else{
            lastColumnIndex = columnIndex;
            sort(lastColumnIndex)
        }
    }
    function sort(columnIndex){
        pokemonData.sort((a, b) => {
            const keyA = a[Object.keys(a)[columnIndex]];
            const keyB = b[Object.keys(b)[columnIndex]];

            if (sortingMinMax == 0){
                if (keyA > keyB) return -1;
                if (keyA < keyB) return 1;
                return 0;
            }
            else{
                if (keyA < keyB) return -1;
                if (keyA > keyB) return 1;
                return 0;
            }
        });
        populateTable();
    }
}

window.onload = abilitySortLoad;
